class SurfSpot extends Component {
    constructor(props) {
        super(props);

        this.state = {
            weather: []
        }
    }



    render() {

    return(          
            <div className="MapMarker">
                <h1>{this.props.name}</h1>
                <Link to={`/spots/${this.props.id}`} >Se mer</Link>
